DESCRIPTION:
Le Jardin est un lieu éco-responsable pour découvrir  créer  partager  penser et savourer ensemble  en plein cœur de Saint-Nazaire. Il est composé de différentes parcelles :
- des espaces de travail (bureaux indépendants et en open-space) : aujourd'hui une dizaine de structures y travaillent dans des secteurs divers (architecture  graphisme  design thinking  naturopathie  stratégie culturelle  réalité virtuelle  visualisation architecturale…) ;
- des espaces ouverts au public : la Cantine du Jardin (café et restauration du midi)  les boutiques Silebo et FFIL  la galerie avec une programmation d'ateliers  de rencontres  d'expositions etc. ;
- des espaces privatisables  pour réunions  séminaires  événements publics ou privés.
